["## Key Takeaways and Recommendations\n","\n","1. Casual riders use our bikes more often on weekends than annual riders. We can capitalize on this by offering membership perks for recreational, cultural, and entertainment activities. This will incentivize casual riders who primarily use our product on weekends to become annual members. It also provides a nice reason for annual riders to renew their memberships and show up to social events on our bikes, boosting our exposure.\n","2. The average ride duration is much longer for casual riders than annual members. We could run an ad campaign notifying casual riders that it is cheaper to become members after a certain number of rides. We could cite the recent surge in gas prices as another reason to ditch their cars and use our product to get to and from work. This combination of economic and environmental incentizes makes our product the most ethical choice on the market."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":101.820457,"end_time":"2022-06-17T18:38:58.636655","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-17T18:37:16.816198","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}